(* Blocks testing*)
let first_chunk = (List.nth (List.nth map.chunks 0) 0)
let first_block = (List.nth (List.nth first_chunk.blocks 0) 0)
let first_block_with_log = Blocks.add_item_to_block Items.log first_block
let first_block_with_2_items = Blocks.add_item_to_block Items.wood_sword first_block_with_log
let first_block_with_sword = Blocks.add_item_to_block Items.wood_sword first_block
let block_tests = "Block tests" >::: [
"test get_block_color" >:: (fun -> assert_equal (Blocks.get_block_color first_block) (ANSITerminal.black));
"test get_block_background_color" >:: (fun -> assert_equal (Blocks.get_block_background_color first_block) (ANSITerminal.on_green));
"test get_block_character" >:: (fun -> assert_equal (Blocks.get_block_character first_block) (' '));
"test get_block_ground" >:: (fun -> assert_equal (Blocks.get_block_ground first_block) (true));
"test get_block_styles" >:: (fun -> assert_equal (Blocks.get_block_styles) ([]));
"test add_item_to_block" >:: (fun -> assert_equal (Items.log)
  (match first_block.sets with
    | [(x,y),_] -> x
    | _ -> failwith "no item"));
"test remove_item_from_block" >:: (fun -> assert_equal (first_block) (Blocks.remove_item_from_block Items.log));
"test count_sets_in_block" >:: (fun -> assert_equal (1) (Blocks.count_sets_in_block first_block_with_log));
"test sets_in_block" >:: (fun -> assert_equal (Blocks.sets_in_block first_block_with_log) ([(Items.log, 1)]));
"test take_first_item" >:: (fun -> assert_equal (first_block_with_sword) (first_block_with_log))
]
